import CircularProgress from '@material-ui/core/CircularProgress'
import React, { useState, useEffect } from 'react'
import { withRouter } from "react-router-dom"
import { Col, Container, Row } from 'react-bootstrap'
import { Link } from 'react-router-dom'
import { getTestsBySubject } from '../api/testsApi'
import AnswerCard from '../components/AnswerCard'
import Question from '../components/Question'
import { Spinner } from '../components/Spinner'
import background from '../assets/images/test-bg.jpg'
import { GetSubjectStatistic, QuestionState, TestWrap } from '../utils/interfaces'
import {useDispatch, useSelector } from 'react-redux'
import { authSelector } from '../store/selectors'
import { addStatistic } from '../store/actions/statistics.actions'


export type AnswerObject = {
    question: string;
    answer: any;
    correct: boolean;
    correctAnswer: any;
}

// const TOTAL_QUESTIONS = 10;

function Test({ match: { params: { subject, theme, testId } } }) {
    const { id } = useSelector(authSelector)
    const dispatch = useDispatch()
    const [loading, setLoading] = useState(false)
    const [showResult, setShowResult] = useState(false)
    const [tests, setTests] = useState<QuestionState[]>([])
    const [userAnswers, setUserAnswers] = useState<AnswerObject[]>([])
    const [statistic, setStatictic] = useState<GetSubjectStatistic[]>([])
    const [score, setScore] = useState(0)
    const [number, setNumber] = useState(0)

    const [gameOver, setGameOver] = useState(true)


    useEffect(() => {
        const getTests = async () => {
            setLoading(true)
            const testsResponse = await getTestsBySubject(subject);
            // @ts-ignore
            testsResponse.map(({ tests }) => {
                setTests(tests)
            })
            setLoading(false)
        }
        getTests()

    }, [])


    const startTrivial = async () => {
        setLoading(true)
        setGameOver(false)
        // const newQuestions = await fetchQuizQuestions(TOTAL_QUESTIONS, Difficulty.EASY)
        // setQuestions(newQuestions)
        setScore(0)
        setUserAnswers([])
        setNumber(0)
        setLoading(false)
        setShowResult(false)
    }

    const checkAnswer = async (e: React.MouseEvent<HTMLElement>) => {
        if (!gameOver) {
            // Users answer
            const answer = e
            // Check answer against correct answer
            // console.log(tests[number].content.answer === answer)
            // @ts-ignore
            const correct = tests[number].content.answer === answer
            // Add score if answer is correct
            if (correct) setScore(prev => prev + 1)
            // Save answer in the array for user answers
            const answerObject = {
                question: tests[number].title,
                answer,
                correct,
                correctAnswer: tests[number].content.answer
            }

            setUserAnswers(prev => [...prev, answerObject])
        }
    }

    const nextQuestion = () => {
        // Move on to the next question if not the last question
        const nextQuestion = number + 1
        if (nextQuestion === tests.length) {
            setGameOver(true)
            setShowResult(true)
            const statiscticsObject = {
                correct: score,
                missed: 0,
                subject,
                testTitle: theme,
                testWrapID: testId,
                total: tests.length,
                userId: id,
                wrong: 3
            }
            console.log("statiscticsObject", statiscticsObject)
            dispatch(addStatistic(statiscticsObject))
        } else {
            setNumber(nextQuestion)
        }

    }

    return (
        <section style={{ backgroundImage: `url(${background})` }} className="test d-flex align-items-center justify-content-center">
            <Container>
                <Row>
                    <Col lg={{ span: 10, offset: 2 }}>
                        <div className="text-center wrapper-test p-5">

                            <h4 className="text-white">Запитання</h4>
                            <h5 className="text-white">Тест по: {theme}</h5>
                            {showResult ? (
                                <>
                                    <span className="text-white d-inline-block my-5" style={{fontSize: '24px'}}>
                                        <svg width="96" height="96" viewBox="0 0 48 48" fill="none" xmlns="http://www.w3.org/2000/svg"
                                             xmlnsXlink="http://www.w3.org/1999/xli nk">
<rect width="48" height="48" fill="url(#pattern0)"/>
<defs>
<pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
<use xlinkHref="#image0" transform="scale(0.00833333)"/>
</pattern>
<image id="image0" width="120" height="120" xlinkHref="data:image/png;base64,"/>
</defs>
</svg>
                                        <br/>
                                        <span className="d-inline-block mt-5">
                                            Ви закінчили тест, набравши {score} правильних відповідей.
                                            <br/>
                                            Бажаємо успіхів!
                                        </span>
                                    </span>
                                </>
                            )  : null}
                            {gameOver || userAnswers.length === tests.length + 1 ? (
                                <button
                                    className="btn btn-primary d-block m-auto"
                                    onClick={startTrivial}
                                >
                                    Розпочати
                                </button>
                            ) : null}

                            <div className="d-flex my-3 justify-content-around">
                                {!gameOver ? <h4 className="score text-white">Балів: {score} </h4> : null}
                                {!gameOver ? <h4 className="text-white">
                                    <span>
                                     Запитання: {number + 1} / {tests.length}
                                    </span>
                                </h4> : null}
                            </div>
                            {loading ? <CircularProgress color="secondary" /> : null}

                            {!loading && !gameOver && (
                                <AnswerCard
                                    totalQuestions={tests.length}
                                    question={tests[number].title}
                                    answers={tests[number].content}
                                    callback={checkAnswer}
                                    userAnswer={userAnswers ? userAnswers[number] : undefined}
                                />)}
                            {!gameOver && !loading && userAnswers.length === number + 1 ? (
                                <button  className='btn btn-secondary' onClick={nextQuestion}>
                                    {userAnswers.length === tests.length ? "Закінчити тест" : "Наступне запитання"}
                                </button>
                            ) : null}
                        </div>


                    </Col>
                </Row>
            </Container>
        </section>
    )
}

export default withRouter(Test)
